def get_pdf_content_lines(full_path):
	#print("THIS IS THE FILE PATH",pdf_file_path)
	with open(os.path.abspath(full_path),'r') as f:
		spamreader = csv.reader(f, delimiter=',')
		length = len(f.readlines())-3
		f.seek(0)
		flag = "not_set"
	
		for line_no, value in enumerate(spamreader):
			print("THE VALUE OF VALUE", value)
			if "NAME" in value:
				next(spamreader)
				next(spamreader)
				
			if line_no == length:
				flag = "set"
				#print("HELLO")
			yield value, flag

